function Food({name, pic,rating}) {
    console.log(name);
    return (
        <div>
            <h3>I LOVE {name}</h3>
            <h4>{rating}/5.0</h4>
            <img src={pic}/>
        </div>
    );
}

const foodList = [
    {
        id:1,
        name: "돈까스",
        rating: 4.5,
        image: "data:image/jpeg;base64,"
    },
    {
        id:2,
        name: "돼지국밥",
        rating: 4.3,
        image: "data:image/jpeg;base64,"

    },
    {
        id:3,
        name: "햄버거",
        rating: 4,
        image: "data:image/jpeg;base64,"
    }
];

function renderFood(dish) {
    return <Food key={dish.id} name={dish.name} pic={dish.image} rating={dish.rating}/>;
}


//return:화면 렌더링 무조건 1개의 html 태그만 사용
function App() {
    //이 곳은 일반적이 js 소드코드 부분
    // foodList.map (dish =>(<Food pic={dish.image}/>))}

    //return 화면을 생성하는 가상 DOM 부분
    return (
        //부모태그는 반드시 1개만 존재해야 함(자식태그는 상관없음)
        //jsx 문법에서 class라는 키워드는 자바스크립트의 클래스 키워드와 겹치기 때문에 자바스크립트의 클래스와 css 선택자의 class를 구분하기 위해서 css 선택자인 class를 className으로 사용함
        <div className="App">
            {/*SPA: Single Page Application 을 줄임말, index.html 과 같은 하나의 화면 구성 파일로 모든 화면을 구성하는 웹 페이지*/}
            {/*SPA는  프론트엔드 프레임워크를 사용하여 하나의 화면에서 필요한 부분을 실시간으로 변경하여 웹을 표시함, 해당 화면을 구성하는 요소를 컴포넌트라고 함*/}
            {/*컴포넌트: 리액트에서 화면을 구성하는 요소*/}

            {/*{}:jsx문법에서 {} 데이터를 표현하는데 사용함, 간단한 연산식도 사용이 가능함*/}

            {/*Food라는 컴포넌트에 변수명이 fav이고, 데이터가 'kimchi' 인 데이터를 전달*/}
            {/*{foodList.map(dish => (<Food name={dish.name} pic={dish.image}/>))}*/}
            {foodList.map((dish)=> renderFood(dish))}

            <h1>리액트 사용하기</h1>
        </div>
    );
}

//매개변수로 사용되는 데이터를 체크
//매개변수의 이름까지 체크할 수 있음
//isRequired : 해당 부분이 반드시 필요하다는 의미, 없으면 오류발생
Food.propTypes={
    name: PropTypes.string.isRequired,
    pic: PropTypes.string.isRequired,
    rating:PropTypes.number.isRequired
};

export default App;
